import React, { useContext } from 'react'
import {UserContext} from '../Context/ProviderContext'
function IncomeExpense() 
{

  const {transaction} = useContext(ProviderContext);
  return (
    <div>
      <div>
        <h4>INCOME</h4>
        <p>₹ <span>0</span></p>
      </div>
      <div>
        <h4>EXPENSE</h4>
        <p>₹ <span>0</span></p>
      </div>
    </div>
  )
}

export default IncomeExpense
